INSERT INTO course(course_id, name, identifier, description, alternate_name, referable)
VALUES ('611233ac-33ff-40eb-811d-859542d9b2f1', 'Green Course', 'GC', 'Ascit supra utique traho vomica depulso. Sui cohaero exercitationem tollo eligendi denuncio aperte utrum summa. Despecto umbra cunctatio degenero vulnus turpis comparo conturbo succurro vilitas. Illo cresco suspendo eos curatio textus vomica.', 'GC', true),
       ('e213bb78-9e83-4345-9d26-c5b7c8d5bc3d', 'Tan Course', 'TC', 'Addo comedo ipsam speciosus. Maxime cauda sustineo turpis urbanus. Thema deorsum totam deinde verumtamen sumo certus pecto. Amor paens bellicus cibus illo ambitus coepi. Soluta carmen accendo cruentus vulgo adstringo cognomen deleniti. Demergo contigo ocer ademptio vicinus verto curto barba curia.', 'TC', true),
       ('8fc715f5-9fb4-48a8-91cd-b0718e1c4488', 'Sky Blue Course', 'SBC', 'Deserunt totidem pectus acidus alioqui delectatio antiquus. Et a adopto clibanus complectus nulla.', 'SBC', false),
       ('e019040b-4d31-425f-a406-5fd26c8f4390', 'Violet Course', 'VC', 'Asper dolore accommodo quibusdam amaritudo adopto venustas tempus. Cattus voluptatum quas trans deleo assumenda adsum ad vis. Cornu cura addo curtus stultus triduana teres apto ex laborum.', 'VC', false),
       ('d493aeec-7f78-43a7-aecf-6f4a0e78a7b1', 'Gold Course', 'GC', 'Vel denique velut aspernatur cubo. Demitto suffoco capitulus eius creta degero. Vacuus comis coniuratio deporto tribuo territo demum desolo solio. Voluptates cohors tersus verecundia vesper cervus substantia verbera totam sustineo.', 'GC', false),
       ('822d2a50-3b01-44e7-b804-b4f6a55ea4ce', 'Red Course', 'RC', 'Villa via volup. Nemo pauci assentator urbs.', 'RC', true),
       ('e34e0880-cb16-402a-9f8c-80441fe30051', 'Black Course', 'BC', 'Debitis nemo ter comburo theatrum crux. Virtus ceno tabgo. Collum tutis abscido provident talis. Terra cognatus corpus apparatus super tersus animi repellendus eligendi. Argentum adeptio timidus valens adversus.', 'BC', false),
       ('daf4be78-794b-4b83-bdd1-9185adf2560b', 'Azure Course', 'AC', 'Accendo nihil abeo colo sumo verbera. Speculum quisquam depereo spiculum. Aptus asperiores odit creator capillus dens torrens crepusculum statua. Constans pariatur confugo vomica.', 'AC', true),
       ('91c6d4bc-135f-40ed-9507-37f7c68a923d', 'Fuchsia Course', 'FC', 'Dedecor strenuus talus conculco articulus termes alveus. Dolorem copiose adsum incidunt iusto acervus auctor consectetur. Tamisium volva aliquam audeo baiulus civis suffragium canis victoria ventosus. Cuppedia colligo tertius cuius porro suscipio.', 'FC', true),
       ('2f22366e-8a51-46fb-ab8f-ff0ce47fe7dc', 'Salmon Course', 'SC', 'Pecco arceo aetas ara at. Tempus velum studio calco amplus clamo tutis. Illum sperno aetas apparatus damnatio arcesso eaque averto alioqui expedita. Arx cumque demulceo uterque cursim barba demitto vomer. Bestia spectaculum tergum. Comburo ipsam tergeo careo atque ara defendo.', 'SC', false);

